		}

		function hideBox() {
			//Reset
			$('.overlay-more').remove();
			$('.box-scroll .box').show();

			var containerWidth = $('.box-scroll').innerWidth();
			var boxWidth = $('.box-scroll .box').outerWidth()+30;
			var boxTotal = $('.box-scroll .box').length;

			for (var i=1;i<=boxTotal;i++)
			{
				if (boxWidth * i > containerWidth)
				{
					break;
				}
			}

			if (boxTotal>=i)
			{
				var html = 'View %s more';
				var more = total_found_packs-i+2;
				if (more == total_found_packs) html = html.replace(" more", " packs").replace(" más", " packs");
				html = html.replace("%s", more);
				$('.box-scroll .box:nth-child('+ (i-1) +')').prepend(html);
				$('.box-scroll .box:nth-child(n+'+ i +')').hide();
			}

		}

